    <p className="text-xl mt-4 text-black">Join thousands of users who trust AstraTax for smart, AI-powered tax filing.</p>
    <button className="mt-6 px-8 py-4 bg-black text-white font-bold rounded">
      Get Started Now
    </button>
  </section>
  );
};

